import './App.css';
import Sidebar from './components/Sidebar';
import Users from './components/Users';


function App() {
  return (
    <>

    <div className="container-fluid">
      <div className="row d-flex justify-content-around p-2">


        <div className="p-0 m-0" style={{width:"20%",height:"735px"}}>
          <Sidebar/>
        </div>



        <div className="bg-dark m-0 p-0 text-white" style={{width:"58%",height:"735px",borderRadius:"10px"}}>
          <Users/>
        </div>
        <div className="bg-dark my-2 text-white" style={{width:"20%",height:"735px",borderRadius:"10px"}}>
          <Users/>
        </div>

      </div>
    </div>



    </>
  );
}

export default App;
